public class LeetCode167TwoSumIIInputArrayIsSorted : BaseProblemClass
{
    public int[] TwoSum(int[] numbers, int target)
    {
        int targetPos = 0;
        if (target < numbers[^1] && numbers[0]>0 )
            targetPos = FindTargetPos(numbers, target);
        else
            targetPos = numbers.Length - 1;
        int firstPointer = 0;
        int secondPointer = targetPos;
        int sum = 0;
        while (firstPointer != secondPointer)
        {
            sum = numbers[firstPointer] + numbers[secondPointer];
            if (sum == target)
                return [firstPointer + 1, secondPointer + 1];
            if (sum > target)
                secondPointer--;
            else
                firstPointer++;
        }

        return [];
    }

    int FindTargetPos(int[] numbers, int target)
    {
        int length = numbers.Length - 1;
        int begin = 0;
        int end = length;
        int mid = 0;
        int newMid = 0;
        int next = 0;
        while (true)
        {
            mid = (begin + end) / 2;
            if (numbers[mid] == target)
            {
                next = newMid < length ? newMid + 1 : newMid;
                return next;
            }

            if (target > numbers[mid])
                begin = mid;
            else
                end = mid;
            newMid = (begin + end) / 2;
            if (newMid == mid)
            {
                next = newMid < length ? newMid + 1 : newMid;
                return next;
            }
        }
    }

